import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({

    Icon:{
      color: 'gray',
      height: 20

    },
    FormControl:{
        minWidth: 12000
      },
      list: {
        width: 200
      },
      fullList: {
        width: "auto"
      },
      link: { textDecoration: 'none' },
    
      palette: {
        primary: {
          main: '#ffffff',
        },
        secondary: {
          main: '#76B900',
        },
      }
  });
  export default useStyles
